@Jloupra3324 Peut-être pas éthylique mais certainement atteint de schizophrénie paranoïde , un délire obsessionnel. 
Il vit dans le passé ; il a parlé des criminels genocidaires  tels Lénine et Staline ; il les vénère .
Ce type vieillit mal .

Percevoir entre la volupté;
Cela fait longtemps,
La chair à son pied,
Le constat par éloquence;
Se vénère amoureusement;
Au cas où la convoitise;
Était vide;
Confier la divinité,
Quelle est la convoitise;
Un dieu au mouvement final.

